            <div className="home-in-one">
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Aperiam voluptate, atque corporis, voluptatibus error pariatur dolores explicabo optio facere quas quam ipsam quia dolor iste fuga? Non quaerat nostrum recusandae. Lorem ipsum, dolor sit amet consectetur adipisicing elit. Praesentium, cumque ab at vel architecto, eius consectetur culpa fugit provident modi assumenda officiis omnis tenetur magnam repellendus veritatis earum? Enim, consectetur.</p>
